import parse_csv as pc
import csv_to_matrix as ctm
import distance as dis
import test


def distance_dict():
    data = ctm.csv_to_matrix("graph.csv")
    name = []

    for i in range(1, len(data)):
        name.append(data[i][1])

    dist = dis.get_distance_list()
    names = dict(zip(name, dist))

    return names


def get_edges_predicted_duration_new(date):
    data = ctm.csv_to_matrix('data-all-final-new.csv')

    pn = pc.parse_csv()
    p = []
    for i in range(1, len(pn)):
        p.append(pn[i].get('name'))

    for i in range(len(data)):
        del data[i][1254:]

    dist = distance_dict()
    res = []

    for j in range(len(p)):
        if str(p[j]) in dist.keys():
            speed = float(data[date][data[0].index(str(p[j]))])
            if speed == 0:
                time = 0
            else:
                time = (dist.get(str(p[j])) / speed) * 60
            t = float(round((round(time, 2) - int(round(time, 2))) * 60)) / 100 + int(round(time, 2))
            res.append(t)

    return res


def create_duration_predicted_csv():
    data = ctm.csv_to_matrix('data-all-final-new.csv')
    p = data[0]

    p.remove('867')
    p.remove('875')
    p.remove('876')
    p.remove('882')
    p.remove('883')
    p.remove('1026')
    p.remove('1035')
    p.remove('1061')

    csv = open('times.csv', 'w')

    for i in range(len(data)):
        if i == 0:
            ls1 = p
        else:
            ls1 = get_edges_predicted_duration_new(i) + data[i][1254:]
        csv.writelines(','.join([str(x) for x in ls1]) + "\n")

    csv.close()


